import LanguageIcon from "@material-ui/icons/LanguageIcon";
const Header = () => {
	return (
		<header className="header">
			<div className="header-inner">
				<a className="logo" href="/">
					<img src="../../static/academy-logo.svg" alt="" />
					<div className="logo-text">Academy</div>
				</a>
				<nav>
					<ul>
						<li>
							<a href="/">探索</a>
						</li>
						<li>
							<a href="/">我的課程</a>
						</li>
					</ul>
				</nav>
				<div className="person-box">
					{/* <div className="language" style={{ color: "#fff" }}>
						<IconLan />
					</div> */}
					<IconButton>
						<Icon>LanguageIcon</Icon>
					</IconButton>
					<div className={avatarStyle.avatarMl}>E</div>
				</div>
			</div>
		</header>
	);
};

export default Header;
